
SET SQL_MODE="NO_AUTO_VALUE_ON_ZERO";




CREATE TABLE IF NOT EXISTS `channels` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(32) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 AUTO_INCREMENT=3 ;



CREATE TABLE IF NOT EXISTS `charservers` (
  `channel` int(11) NOT NULL,
  `address` varchar(15) NOT NULL,
  `port` int(11) NOT NULL default '29100'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;



CREATE TABLE IF NOT EXISTS `mobgroups` (
  `id` int(11) NOT NULL auto_increment,
  `map` int(11) NOT NULL,
  `x` float NOT NULL,
  `y` float NOT NULL,
  `range` int(11) NOT NULL,
  `respawntime` int(11) NOT NULL,
  `limit` int(11) NOT NULL,
  `tacticalpoints` int(11) NOT NULL,
  `moblist` varchar(1024) default NULL,
  `daynight` int(11) NOT NULL default '0',
  `isactive` int(11) NOT NULL default '1',
  `whatisit` varchar(20) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=11703 ;





CREATE TABLE IF NOT EXISTS `npcs` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(255) NOT NULL,
  `type` int(11) NOT NULL,
  `map` int(11) NOT NULL,
  `dir` float NOT NULL,
  `x` float NOT NULL,
  `y` float NOT NULL,
  `dialogid` int(11) NOT NULL default '0',
  `eventid` int(11) NOT NULL default '0',
  `tempdialogid` int(11) NOT NULL default '0',
  `extra_param` int(11) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 AUTO_INCREMENT=320 ;





CREATE TABLE IF NOT EXISTS `telegates` (
  `id` int(11) NOT NULL,
  `srcmap` int(10) NOT NULL,
  `srcx` float NOT NULL,
  `srcy` float NOT NULL,
  `destmap` int(10) NOT NULL,
  `destx` float NOT NULL,
  `desty` float NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;





CREATE TABLE IF NOT EXISTS `users` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(32) NOT NULL,
  `pass` varchar(32) NOT NULL,
  `level` int(11) NOT NULL default '0' COMMENT '-1,0,1,2,3',
  `char` varchar(32) default NULL COMMENT 'Current character.',
  `world` int(1) default NULL COMMENT 'Current world server ID.',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 AUTO_INCREMENT=12 ;



CREATE TABLE IF NOT EXISTS `worldservers` (
  `channel` int(11) NOT NULL,
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(32) NOT NULL,
  `address` varchar(15) NOT NULL,
  `port` int(11) NOT NULL default '29200',
  `restrict` int(11) NOT NULL default '2',
  `clients` int(11) NOT NULL default '0',
  `limit` int(11) NOT NULL default '1000',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 AUTO_INCREMENT=5 ;
